import Data from '../data/data.json';
import Product from './Product';

function Men() {
  const renderedItems = Data.map(item => {
    if (item.gender === 'men') {
      return(
        <Product 
        key={item.id}
        imgUrl={`/images/products/${item.imageFile}`}
        name={item.name}
        description={item.description}
        price={item.price}
        discount={50}
      />
      )
    }
  })
  return(
    <div>{renderedItems}</div>
  )
}

export default Men;
